import React from 'react'
import Link from 'react-router-dom'

const Navbar = () => {
        return(
            <nav>
                <div className="nav-wrapper red darken-4">
                <Link to='/' className="brand-logo center">MovieInfo</Link>
                </div>
            </nav>
        )
    }

export default Navbar
